import React from "react";

import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes";

function createNote(notes){
    return (
        <notes
        id = {notes.key}
        key = {notes.key}
        title = {notes.title}
        content = {notes.content}/>
    );
}

function App(){
    return (
        <div>
            <Header/>
            {notes.map(createNote)}
            <Footer/>
        </div>
    );
}

export default App;
